    --The lobbyist expense report is part of the Lobbyist Activity Report, a notarized
    disclosure that must be filed twice each year (January 20th and July 20th). Lobbyists
    are required to report single expenditures paid by the lobbyist or charged to the
    client totaling $250.00 or more on Form C Part 3 Section H Question 2 (http://bit.ly/q2lRTh).
    All lobbyist activity reports are submitted to the Board of Ethics in paper form
    and are available in their entirety in the Board's offices. The Board has, since
    2000, compiled and posted static lists of all lobbyists and their clients online.
